import React from 'react';
import Auth from '../components/layouts/Auth';

function login({ children }) {
    return (
        <Auth>
            <div>
                <h2 className="font-bold text-xl font-serif">Wellcome Back</h2>
            </div>
            <div>

                {children}
            </div>
        </Auth>
    );
}

export default login;
